import {
  init_esm_shims
} from "./chunk-WWCIODDN.js";

// Modals/CustomEmbed/ce_thumbnail.ts
init_esm_shims();
var ce_thumbnail_default = {
  id: "ce_thumbnail",
  async execute(interaction) {
    const url = interaction.fields.getTextInputValue("url");
    const embed = interaction.message.embeds[0];
    embed.data.thumbnail = {
      url
    };
    interaction.reply({ content: "Die Beschreibung wurde erfolgreich ge\xE4ndert", ephemeral: true });
    await interaction.message.edit({ embeds: [embed] });
  }
};
export {
  ce_thumbnail_default as default
};
